num = ''

biggest = 0
i = 0
while i < len(num)-12:
    one = int(num[i]) 
    two = int(num[i+1])  
    thr = int(num[i+2]) 
    fou = int(num[i+3])
    fiv = int(num[i+4])
    si = int(num[i+5])
    se = int(num[i+6])
    ei = int(num[i+7])
    ni = int(num[i+8])
    te = int(num[i+9])
    el = int(num[i+10])
    tw = int(num[i+11])
    th = int(num[i+12])
    product = one*two*thr*fou*fiv*si*se*ei*ni*te*el*tw*th
    if product > biggest:
        biggest = product
    i=i+1 
print(biggest)


